import React, { Component } from "react";
import moment from "moment";
import { Grid, Segment, Header, List } from "semantic-ui-react";

class Launch extends Component {
  state = {
    countDown: 0
  };

  updateCountdown = () => {
    console.log(moment.duration(moment.utc().diff(moment(this.props.time))));
    this.setState({
      countDown: moment.duration(moment.utc().diff(moment(this.props.time)))
    });
  };

  componentDidMount() {
    this.updateCountdown();
  }

  // componentDidMount() {
  //   this.interval = setInterval(this.updateCountdown, 1000);
  // }

  // componentWillUnmount() {
  //   clearInterval(this.interval);
  // }

  render() {
    return (
      <Segment>
        <Header>{this.props.name}</Header>
        <Grid columns={2} relaxed="very">
          <Grid.Column>
            <List>
              <List.Item>
                <List.Icon
                  circular
                  verticalAlign="middle"
                  name="rocket"
                  color="red"
                />
                <List.Content verticalAlign="middle">
                  <a href={this.props.rocket.link}>{this.props.rocket.name}</a>
                </List.Content>
              </List.Item>

              <List.Item>
                <List.Icon
                  circular
                  verticalAlign="middle"
                  name="group"
                  color="grey"
                />
                <List.Content verticalAlign="middle">
                  <a href={this.props.agency.link}>{this.props.agency.name}</a>
                </List.Content>
              </List.Item>

              <List.Item>
                <List.Icon
                  circular
                  verticalAlign="middle"
                  name="location arrow"
                  color="blue"
                />
                <List.Content verticalAlign="middle">
                  <span>{this.props.location}</span>
                </List.Content>
              </List.Item>

              <List.Item>
                <List.Icon
                  circular
                  verticalAlign="middle"
                  name="calendar outline"
                  color="grey"
                />
                <List.Content verticalAlign="middle">
                  <span>{this.props.time}</span>
                </List.Content>
              </List.Item>
            </List>
          </Grid.Column>

          <Grid.Column>
            <List>
              <List.Item>
                Countdown
                <List.List>{this.state.countDown}</List.List>
              </List.Item>
              <List.Item>
                Video Links
                <List.List>
                  {this.props.links.map((link, i) => (
                    <List.Item key={i}>
                      <a href={link}>{link}</a>
                    </List.Item>
                  ))}
                </List.List>
              </List.Item>
            </List>
          </Grid.Column>
        </Grid>
      </Segment>
    );
  }
}

export default Launch;
